import React, { useState, useEffect } from 'react';
import '../style/Weather.scss'; 
import Logo from '../assets/logo-fintek.png';
import { getWeather } from '../axios/weather.service'; // תיקון בהתאם למיקום הקובץ

const Weather = () => {
  const [inputValue, setInputValue] = useState('');
  const [errorMessage, setErrorMessage] = useState('');
  const [isSubmitted, setIsSubmitted] = useState(false);
  const [weatherData, setWeatherData] = useState(null);
  const [error, setError] = useState(null);

  const handleSubmit = async () => {
    if (!inputValue) {
      setErrorMessage('נא להזין שם עיר.');
    } else if (!/^[a-zA-Z\s]+$/.test(inputValue)) {
      setErrorMessage('השם שהוזן אינו חוקי. יש להזין רק אותיות באנגלית.');
    } else {
      setErrorMessage('');
      setIsSubmitted(true);
    }
  };

  const handleInputChange = (e) => {
    setInputValue(e.target.value);
  };

  useEffect(() => {
    const fetchWeather = async () => {
      try {
        if (inputValue && isSubmitted) {
          const data = await getWeather(inputValue);
          setWeatherData(data);
          setError(null);
        }
      } catch (error) {
        setWeatherData(null);
        setError('Failed to fetch weather data');
      }
    };

    fetchWeather();
  }, [inputValue, isSubmitted]);

  return (
    <div className="weather-container">
      <div className="weather-content">
        {/* לוגו בפינה השמאלית העליונה */}
        <div className="weather-logo">
          <img src={Logo} alt="Logo" className="logo" />
        </div>
        <div className="weather-box">
          <div className={`weather-info ${isSubmitted ? 'hide' : ''}`}>
            <p>Use our weather app to see the weather around the world</p>
            <h5>City name</h5>
            <div className="weather-input-container">
              <input
                type="text"
                placeholder="Enter input..."
                value={inputValue}
                onChange={handleInputChange}
              />
              <button onClick={handleSubmit}>Check</button>
            </div>
            {errorMessage && <p className="error-message">{errorMessage}</p>}
          </div>
          {isSubmitted && (
            <div className="weather-display">
              {weatherData ? (
                <div>
                  <h2>Weather for {weatherData.city}</h2>
                  <p>Temperature: {weatherData.temperature}°C</p>
                  <p>Condition: {weatherData.condition}</p>
                  <p>Humidity: {weatherData.humidity}%</p>
                  <p>Wind Speed: {weatherData.wind} kph</p>
                </div>
              ) : error ? (
                <p>{error}</p>
              ) : (
                <p>Enter a city to get the weather information.</p>
              )}
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default Weather;
